import '../styles/Menu.css';
import Select from 'react-select';
const options = [
  { value: 'apple', label: 'Apple' },
  { value: 'banana', label: 'Banana' },
  { value: 'orange', label: 'Orange' },
  { value: 'pear', label: 'Pear' }
];
function Menu(selectedModel,setSelectedOption) {
  const myModel = [
    { text: 'Sklearn', value: 'atl' },
    { text: 'Python', value: 'ber'},
    { text: 'C++', value: 'chi'},
  ];
  return (
    <div className="Menu">
      
        
        <Select
        data={myModel}
        display="inline"
        touchUi={false}
        />
        <p>
          Info
        </p>
        <p>
          Dataset
        </p>
      
    </div>
  );
}

export default Menu;
